Template for prompt: Improve the css code. 'use client';

import { Input } from '@/components/ui/input';
import { useChat } from 'ai/react';

export default function Chat() {
  const { messages, input, handleInputChange, handleSubmit } = useChat();
  return (
    <div className='flex w-full'>
      {messages.map((m) => (
        <div
          key={m.id}
          className='whitespace-pre-wrap text-[#E1BBC9] w-full'
        >
          {m.role === 'user' ? 'Pema Wangchuk: ' : 'FalconAI: '}
          <span className='text-justify mx-4'>{m.content}</span>
        </div>
      ))}

      <form onSubmit={handleSubmit}>
        <Input
          className='fixed bottom-0  text-white w-full max-w-md p-8 mb-8 border border-green-600 rounded shadow-xl'
          value={input}
          placeholder='Ask Any Question...'
          onChange={handleInputChange}
        />
      </form>
    </div>
  );
}

